import React from 'react';
import LucasFace from "../assets/Lucas_Pao.JPG";
import {Redirect} from 'react-router-dom';

class Experience extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            redirectLink: "/experience"
        };
    }

    handleClick(page) {
        const link = this.state.redirectLink.concat(page);
        this.setState({redirectLink: link})
    }

    render() {
        if(this.state.redirectLink !== "/experience") {
            return <Redirect to={this.state.redirectLink}/>
        }
        return (
            <div>
                <div>
                    <h1>Experience</h1>
                    <h2>Education</h2>
                    <div>
                        <h3>Sep 2019 - May 2023:</h3>
                        <p>HARVARD UNIVERSITY | Cambridge, MA</p>
                        <p>B.A. in Computer Science (Honors), Minor in Mathematics</p>
                        <p>Honors: Cum Laude</p>
                        <p>Coursework: Machine Learning, Data Structures and Algorithms, Systems Programming, Product Design, Theoretical Computer Science, Probability, Abstract Algebra, Complex Analysis</p>
                    </div>
                    <div>
                        <h3>Sep 2023 - Jul 2024:</h3>
                        <p>BERKLEE COLLEGE OF MUSIC | Boston, MA {'\u2192'} New York, NY</p>
                        <p>M.A. Candidate in Creative Media and Technology</p>
                        <p>Harvard-Berklee Dual Degree Program</p>
                    </div>
                    <br/><br/>
                <div/>

                <h2>Work Experience</h2>
                </div>
            </div>
        );
    }
}

export default Experience;
